import React from 'react';
import '../../App.css';

export default function Courses() {
  const myStyle = {
    backgroundColor: "#74bc3c",
    backgroundPosition: "center",
    backgroundSize: "fill",
    backgroundRepeat: "no-repeat",
    color: "black",
    fontSize: "20px",
    width: '100vw',
    height: '100vh',
    textAlign: "center",
    marginTop: "80px",
    position: "absolute",
    top: 0
  };
  return (
    <div className="course-form-container" style={myStyle}>
      <img src={require('/Users/alyssaingerson/Documents/GitHub/TheLearningLab/my-app/frontend/src/logo.jpeg')} alt='logo image' height={200} width={200} />            
      <h2>Create Course</h2> 
    </div>
  );
}
